import logo from '../assets/breakout_uty_logo.png';
import whatsapp from '../assets/wtsp_logo.png';

const Header = () => {
    return (
        <div className="header">
            <img src={logo} alt="logo" />
            <img src={whatsapp} alt="" />
            <div>
                Digital Learning Platform

            </div>
        </div>
    );
}

export default Header;
